export const Home = () => {
  return (
    <div className="ratio ratio-16x9">
      <iframe
        src="https://www.youtube.com/watch?v=SSo_EIwHSd4"
        title="¿Cómo funciona Blockchain?"
        allowfullscreen
      ></iframe>
    </div>
  );
};
